import React from 'react';
import { Link , useNavigate} from 'react-router-dom';

const Navbar = () => {
  
    const navigate = useNavigate();
  
    const handleLogout = () => {
      localStorage.removeItem('userRole'); // Clear user data from localStorage
      navigate('/Login'); // Redirect to the login page
    };
  return (
    <nav>
      <div className="logo">
        Edu Sphere
      </div>
      <ul>
        
          
            <li><Link to="/faculty-home">Home</Link></li>
            <li><Link to="/Marks">Marks</Link></li>
          
        
        
          
            <li><Link to="/student-home">Home</Link></li>
            <li><Link to="/Stumarks">Student Marks</Link></li>
          
        
        
          
            <li><Link to="/management-home">Home</Link></li>
            <li><Link to="/Gallery">Gallery</Link></li>
          
        
       
          
            <li><Link to="/non-technical-home">Home</Link></li>
            <li><Link to="/About">About</Link></li>
          
        
        
        
            <li><Link to="/Home">Home</Link></li>
            <li><Link to="/Login">Login</Link></li>
            <li><Link to="/Reg">Register</Link></li>
          
        
      </ul>
    </nav>
  );
};

export default Navbar;
